import React from 'react';
import UpscaleUploadPage from './pages/UpscaleUploadPage';
import Home from './pages/Home';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function UpscaleUpload() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/upscaleUploadPage" element={<UpscaleUploadPage />} />
      </Routes>
    </Router>
  );
}

export default UpscaleUpload;
